import React from 'react';
import { Container, Tabs, Tab, Box } from '@mui/material';
import MarketDataTab from './components/MarketDataTab';
import NewsTab from './components/NewsTab';
import SECFilingsTab from './components/SECFilingsTab';
import SocialSentimentTab from './components/SocialSentimentTab';
// You can add more imports for other agent tabs

function App() {
  const [tab, setTab] = React.useState(0);

  return (
    <Container maxWidth="xl" sx={{ mt: 4 }}>
      <h1>ðŸ“ˆ Market Trend Multi-Agent Dashboard</h1>
      <Tabs value={tab} onChange={(_, v) => setTab(v)} variant="scrollable" scrollButtons="auto">
        <Tab label="Market Data" />
        <Tab label="News" />
        <Tab label="SEC Filings" />
        <Tab label="Social Sentiment" />
        <Tab label="Macro" />
        <Tab label="Company Events" />
        <Tab label="Startup Signals" />
        <Tab label="NLP Extraction" />
      </Tabs>
      <Box sx={{ mt: 3 }}>
        {tab === 0 && <MarketDataTab />}
        {tab === 1 && <NewsTab />}
        {tab === 2 && <SECFilingsTab />}
        {tab === 3 && <SocialSentimentTab />}
        {/* Add other tab components here */}
      </Box>
    </Container>
  );
}

export default App;
